create table club_league_history
(
    club_id    varchar
        constraint club_league_history_club_id_fk
            references club,
    league_id  varchar
        constraint club_league_history_league_id_fk
            references league,
    start_year integer,
    end_year   integer
);

alter table club_league_history
    owner to postgres;

create index club_league_history_end_year_idx
    on club_league_history (end_year);

create index club_league_history_start_year_idx
    on club_league_history (start_year);

grant select on club_league_history to inode_readonly;

